def extractValue = {
  if (it) {
    it.p.value()
  }
  else {
    ''
  }
}

//in der Liste werden alle Einträge gesammelt, die in das values-Attribut des DataArrays geschrieben werden sollen, mit dessen hilfe das result repräsentiert wird
def list = []

