  list << entstehungsartOderKlimastufeWasserverhaeltnisse.p.values().join('|')
}
else {
  list << ''
}
list << extractValue(bodenzahlOderGruenlandgrundzahl)
list << extractValue(ackerzahlOderGruenlandzahl)
if (sonstigeAngaben) {
  list << sonstigeAngaben.p.values().join('|')
}
else {
  list << ''
}
